import React from 'react';

const Contact = ({ onRouteChange }) => {
    return (
        <nav style={{color: 'white', display: 'flex', justifyContent: 'flex-end' }} className='bg-dark-gray { background-color: #333333 }'>
            <p onClick={() => onRouteChange('form')} className='f3 link dim pa3 pointer'>Form</p>
            <p onClick={() => onRouteChange('home')} className='f3 link dim pa3 pointer'>Home</p>
            <p onClick={() => onRouteChange('thankyou')} className='f3 link dim pa3 pointer'>Thank you</p>
        </nav>
    );
}

export default Contact;
